/*Table structure for table `pf_gmuni_resource_privilege` */

DROP TABLE IF EXISTS `pf_gmuni_resource_privilege`;

CREATE TABLE `pf_gmuni_resource_privilege` (
  `ID` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `resource_code` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '资源编码',
  `priv_code` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '权限编码',
  `priv_type` char(10) COLLATE utf8_bin DEFAULT NULL COMMENT '权限类型1:组织机构 2：角色 3：工作组',
  `resource_type` char(10) COLLATE utf8_bin DEFAULT NULL COMMENT '资源类型 1:菜单 2:按钮',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `pf_gmuni_resource_privilege` */

/*Table structure for table `pf_gmuni_role` */

DROP TABLE IF EXISTS `pf_gmuni_role`;

CREATE TABLE `pf_gmuni_role` (
  `id` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '角色主键',
  `code` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '编码',
  `name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '名称',
  `create_time` datetime DEFAULT NULL COMMENT '添加时间',
  `state` char(10) COLLATE utf8_bin DEFAULT NULL COMMENT '状态 0:禁用 1:启用',
  `remark` varchar(1000) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

