/*Table structure for table `pf_gmuni_upload` */

DROP TABLE IF EXISTS `pf_gmuni_upload`;

CREATE TABLE `pf_gmuni_upload` (
  `id` varchar(50) COLLATE utf8_bin NOT NULL,
  `name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '文件名称',
  `format` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '文件类型',
  `size` decimal(10,0) DEFAULT NULL COMMENT '文件大小',
  `last_modified` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '文件最后修改时间',
  `create_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

