/*Table structure for table `sc_gmuni_pay_log_wechat` */

DROP TABLE IF EXISTS `sc_gmuni_pay_log_wechat`;

CREATE TABLE `sc_gmuni_pay_log_wechat` (
  `appid` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '公众账号ID',
  `mch_id` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '商户号',
  `device_info` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '设备号',
  `nonce_str` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '微信支付返回的随机字符串',
  `sign` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '微信支付签名',
  `sign_type` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '签名类型',
  `result_code` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '业务结果',
  `err_code` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '错误代码',
  `err_code_des` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '错误代码描述',
  `openid` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '用户标识',
  `is_subscribe` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '是否关注公众账号',
  `trade_type` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '交易类型',
  `bank_type` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '付款银行',
  `total_fee` decimal(10,0) DEFAULT NULL COMMENT '订单金额',
  `settlement_total_fee` decimal(10,0) DEFAULT NULL COMMENT '应结订单金额',
  `fee_type` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '货币种类',
  `cash_fee` decimal(10,0) DEFAULT NULL COMMENT '现金支付金额',
  `transaction_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '微信支付订单号',
  `out_trade_no` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '商户订单号',
  `attach` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '商家数据包',
  `time_end` datetime DEFAULT NULL COMMENT '支付完成时间'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `sc_gmuni_pay_log_wechat` */

/*Table structure for table `sc_gmuni_repair` */

DROP TABLE IF EXISTS `sc_gmuni_repair`;

CREATE TABLE `sc_gmuni_repair` (
  `id` varchar(100) COLLATE utf8_bin NOT NULL,
  `device_code` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '设备编码',
  `reason_r` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '报修原因',
  `user_r` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '报修人',
  `failure_cause` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '故障描述',
  `maintenance` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '维护人',
  `time_repair` datetime DEFAULT NULL COMMENT '报修时间',
  `time_maint` datetime DEFAULT NULL COMMENT '维护时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

