/*Table structure for table `sc_gmuni_wallet` */

DROP TABLE IF EXISTS `sc_gmuni_wallet`;

CREATE TABLE `sc_gmuni_wallet` (
  `id` varchar(50) COLLATE utf8_bin NOT NULL,
  `pwd` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '用户支付密码',
  `amount` decimal(10,2) DEFAULT NULL COMMENT '余额',
  `school_code` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '学校编码',
  `create_time` datetime DEFAULT NULL COMMENT '开户时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `user_code` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '用户账号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

