/*Table structure for table `sc_gmuni_wallet_payment` */

DROP TABLE IF EXISTS `sc_gmuni_wallet_payment`;

CREATE TABLE `sc_gmuni_wallet_payment` (
  `id` varchar(50) COLLATE utf8_bin NOT NULL,
  `amount` decimal(10,2) DEFAULT NULL COMMENT '订单金额',
  `buyer_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '买家账号',
  `seller_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '卖家账号',
  `payment_type` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '支付类型（购物，饮水机，咖啡机等等）',
  `status` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '支付状态（正在付款，已付款，付款失败）',
  `sign` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '支付签名',
  `title` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '商品名称',
  `remark` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '支付备注',
  `create_time` datetime DEFAULT NULL COMMENT '交易创建时间',
  `pay_time` datetime DEFAULT NULL COMMENT '交易付款时间',
  `end_time` datetime DEFAULT NULL COMMENT '交易结束时间',
  `order_number` varchar(300) COLLATE utf8_bin DEFAULT NULL COMMENT '订单号',
  `serial_number` varchar(300) COLLATE utf8_bin DEFAULT NULL COMMENT '流水号',
  `error_code` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '异常编码',
  `trade_balance` decimal(10,2) DEFAULT NULL COMMENT '交易后余额',
  `pay_mode` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '支付方式0:支付宝1:一卡通2:微信',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

