/*Table structure for table `sc_gmuni_wallet_recharge` */

DROP TABLE IF EXISTS `sc_gmuni_wallet_recharge`;

CREATE TABLE `sc_gmuni_wallet_recharge` (
  `id` varchar(45) COLLATE utf8_bin NOT NULL,
  `amount` decimal(10,2) DEFAULT NULL,
  `account` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '充值用户',
  `pay_time` datetime DEFAULT NULL COMMENT '充值付款时间',
  `create_time` datetime DEFAULT NULL COMMENT '充值创建时间',
  `end_time` datetime DEFAULT NULL COMMENT '充值结束时间',
  `status` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '充值状态（已创建，正在充值，充值成功）',
  `order_number` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '订单号',
  `series_number` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '流水号',
  `remark` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '充值备注',
  `pay_mode` varchar(10) COLLATE utf8_bin DEFAULT '0' COMMENT '支付方式 0:支付宝',
  `error_code` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '异常状态码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

